import React from 'react';
import Card from './Card';


function CardList(props) {
  //props.robots
  return (
    <div className="card-list">
  	  <Card robots={props.robots[0]} />
      <Card robots={props.robots[1]} />
      <Card robots={props.robots[2]} />
      <Card robots={props.robots[3]} />
      <Card robots={props.robots[4]} />
    </div>
  );
}

export default CardList;
